After her experience with X-Force, Laura Kinney is still adjusting to life on her own. Strange happenings are afoot, and she unfortunately lands right in the thick of things pretty often. Marjorie Liu writes this great ongoing series that focuses on Laura's place within the X-Universe and her own inner (and outer) demons. Some great artists contribute as well, especially the amazing Phil Noto. This torrent has every issue of the series; most are digital either via Empire (+ZoneKing) or Minutemen-PhD. For the four issues without digital copies, I have added custom noads editions of the CPS scans (by Oroboros and AngelicLegion) and a copy by Minutemen-ThosTwo. Thanks to all the great scanners for their work, please seed and enjoy! :-)
